        public double obtenerFiablidad()
        {
            if (_fsFiabilidad == null)
            {
                _fsFiabilidad = CrearSistemaFiabilidad();
                if (_fsFiabilidad == null)
                {
                    return -1;
                }
            }

            FuzzyVariable fvMadurez = _fsFiabilidad.InputByName("madurez");
            FuzzyVariable fvToleranciaFallos = _fsFiabilidad.InputByName("tolerancia_fallos");
            FuzzyVariable fvRecuperabilidad = _fsFiabilidad.InputByName("recuperabilidad");
            FuzzyVariable fvCumplimientoFiabilidad = _fsFiabilidad.InputByName("cumplimiento_fiabilidad");

            FuzzyVariable fvCalidadFiabilidad = _fsFiabilidad.OutputByName("fiabilidad");



            //
            // Associate input values with input variables
            //
            Dictionary<FuzzyVariable, double> inputValues = new Dictionary<FuzzyVariable, double>();
            inputValues.Add(fvMadurez, fiabilidad.Madurez);
            inputValues.Add(fvToleranciaFallos, fiabilidad.ToleranciaFallos);
            inputValues.Add(fvRecuperabilidad, fiabilidad.Recuperabilidad);
            inputValues.Add(fvCumplimientoFiabilidad, fiabilidad.CumplimientoFiabilidad);
  
            //
            // Calculate result: one output value for each output variable
            //
            Dictionary<FuzzyVariable, double> result = _fsFiabilidad.Calculate(inputValues);

            //
            // Get output value for the 'tips' variable
            //
            if (result[fvCalidadFiabilidad].ToString("f1").Equals("NeuN"))
            {
                Console.WriteLine("ESTA MALO EL VALOR DE FIABILIDAD");
                return -1;
            }
            else
            {
                return result[fvCalidadFiabilidad];
            }
        }


